import React from 'react';
import { motion } from 'framer-motion';
import { useTranslation } from 'react-i18next';
import './Skills.css';

const Skills = () => {
  const { t } = useTranslation();

  // Habilidades tÃ©cnicas (ordenadas por nivel)
  const technicalSkills = [
    { name: 'HTML5/CSS3', level: 95 },
    { name: 'JavaScript (ES6+)', level: 90 },
    { name: 'React', level: 88 },
    { name: 'TypeScript', level: 85 },
    { name: 'Node.js', level: 80 },
    { name: 'SQL/NoSQL', level: 78 },
    { name: 'Git/GitHub', level: 92 },
    { name: 'Firebase', level: 75 },
    { name: 'RESTful APIs', level: 88 },
    { name: 'GraphQL', level: 70 },
    { name: 'React Native', level: 75 },
    { name: 'TailwindCSS', level: 85 }
  ];

  // Habilidades profesionales
  const professionalSkills = [
    { name: t('skills.problemSolving'), level: 95 },
    { name: t('skills.communication'), level: 90 },
    { name: t('skills.teamwork'), level: 92 },
    { name: t('skills.adaptability'), level: 88 },
    { name: t('skills.timeManagement'), level: 85 },
    { name: t('skills.attention'), level: 95 }
  ];

  // Idiomas
  const languages = [
    { name: t('skills.spanish'), level: 100, note: t('skills.nativeLevel') },
    { name: t('skills.english'), level: 85, note: t('skills.advancedLevel') },
    { name: t('skills.french'), level: 60, note: t('skills.intermediateLevel') }
  ];

  // Animaciones sin opacidad
  const containerVariants = {
    hidden: { y: 20 },
    visible: {
      y: 0,
      transition: {
        type: 'spring',
        stiffness: 80,
        damping: 15,
        staggerChildren: 0.1,
        duration: 0.8
      }
    }
  };

  const skillVariants = {
    hidden: { 
      y: 15,
      scaleX: 0
    },
    visible: {
      y: 0,
      scaleX: 1,
      transition: {
        type: 'spring',
        stiffness: 50,
        damping: 10,
        duration: 0.8
      }
    }
  };

  return (
    <motion.section 
      id="habilidades" 
      className="skills-section section-wave-bg"
      variants={containerVariants}
      initial="hidden"
      whileInView="visible"
      viewport={{ once: true }}
    >
      <div className="wave-top">
        <svg data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1200 120" preserveAspectRatio="none">
          <path d="M321.39,56.44c58-10.79,114.16-30.13,172-41.86,82.39-16.72,168.19-17.73,250.45-.39C823.78,31,906.67,72,985.66,92.83c70.05,18.48,146.53,26.09,214.34,3V0H0V27.35A600.21,600.21,0,0,0,321.39,56.44Z" className="shape-fill"></path>
        </svg>
      </div>
      
      <div className="container">
        <div className="section-title">
          <motion.h2 variants={itemVariants}>{t('skills.titulo')}</motion.h2>
          <motion.div className="underline" variants={itemVariants}></motion.div>
          <motion.p className="section-subtitle" variants={itemVariants}>
            {t('skills.subtitulo')}
          </motion.p>
        </div>

        <div className="skills-content">
          {/* Columna de habilidades tÃ©cnicas */}
          <motion.div 
            className="skills-column technical"
            variants={containerVariants}
            initial="hidden"
            whileInView="visible"
            viewport={{ once: true, amount: 0.2 }}
          >
            <h3>{t('skills.technical')}</h3>
            <div className="skills-list">
              {technicalSkills.map((skill, index) => (
                <div className="skill-item" key={index}>
                  <div className="skill-info">
                    <span className="skill-name">{skill.name}</span>
                    <span className="skill-percentage">{skill.level}%</span>
                  </div>
                  <div className="skill-bar">
                    <motion.div 
                      className="skill-progress"
                      style={{ width: `${skill.level}%` }}
                      variants={skillVariants}
                    ></motion.div>
                  </div>
                </div>
              ))}
            </div>
          </motion.div>

          {/* Columna de habilidades profesionales y lenguajes */}
          <div className="skills-right-column">
            {/* Habilidades profesionales */}
            <motion.div 
              className="skills-column professional"
              variants={containerVariants}
              initial="hidden"
              whileInView="visible"
              viewport={{ once: true, amount: 0.2 }}
            >
              <h3>{t('skills.professional')}</h3>
              <div className="skills-list">
                {professionalSkills.map((skill, index) => (
                  <div className="skill-item" key={index}>
                    <div className="skill-info">
                      <span className="skill-name">{skill.name}</span>
                      <span className="skill-percentage">{skill.level}%</span>
                    </div>
                    <div className="skill-bar">
                      <motion.div 
                        className="skill-progress"
                        style={{ width: `${skill.level}%` }}
                        variants={skillVariants}
                      ></motion.div>
                    </div>
                  </div>
                ))}
              </div>
            </motion.div>

            {/* Idiomas */}
            <motion.div 
              className="skills-column languages"
              variants={containerVariants}
              initial="hidden"
              whileInView="visible"
              viewport={{ once: true, amount: 0.2 }}
            >
              <h3>{t('skills.languages')}</h3>
              <div className="skills-list">
                {languages.map((language, index) => (
                  <div className="skill-item" key={index}>
                    <div className="skill-info">
                      <span className="skill-name">{language.name}</span>
                      <span className="skill-note">{language.note}</span>
                    </div>
                    <div className="skill-bar">
                      <motion.div 
                        className="skill-progress"
                        style={{ width: `${language.level}%` }}
                        variants={skillVariants}
                      ></motion.div>
                    </div>
                  </div>
                ))}
              </div>
            </motion.div>
          </div>
        </div>
      </div>
      
      <div className="wave-bottom">
        <svg data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1200 120" preserveAspectRatio="none">
          <path d="M985.66,92.83C906.67,72,823.78,31,743.84,14.19c-82.26-17.34-168.06-16.33-250.45.39-57.84,11.73-114,31.07-172,41.86A600.21,600.21,0,0,1,0,27.35V120H1200V95.8C1132.19,118.92,1055.71,111.31,985.66,92.83Z" className="shape-fill"></path>
        </svg>
      </div>
    </motion.section>
  );
};

export default Skills;
